import { createSlice } from '@reduxjs/toolkit';

// Your existing reducer logic here
const taskSlices = createSlice({
    name: 'tasks',
    initialState: {
        // Your existing state structure
        listData: [],
    },
    reducers: {
        setListData: (state, action) => {
            state.listData = action.payload;
        },
        // Your other reducer actions...
    },
});

export const { setListData } = taskSlices.actions;
export default taskSlices.reducer;
